import React, { useState } from "react";
import {
  Collapse,
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
} from "reactstrap";
import { connect } from "react-redux";
import { logout } from "../../store/actions/authActions";

import { withRouter, NavLink as RRNavLink } from "react-router-dom";
const NavBar = (props) => {
  const [isOpen, setIsOpen] = useState(false);

  const toggle = () => setIsOpen(!isOpen);

  console.log(localStorage.token);

  return (
    <div>
      <Navbar color="light" light expand="md">
        <NavbarBrand href="/">Administraci√≥n de tarjetas</NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink to="/" activeClassName="active" tag={RRNavLink}>
                Dashboard
              </NavLink>
            </NavItem>

            <NavItem>
              <NavLink to="/tarjetas" activeClassName="active" tag={RRNavLink}>
                Mis Tarjetas
              </NavLink>
            </NavItem>
          </Nav>
          {localStorage.token ? (
            <Nav className="ml-auto" navbar>
              <NavItem onClick={props.logout}>
                <NavLink
                  to="/login"
                  onClick={props.logout}
                  activeClassName="active"
                  tag={RRNavLink}
                >
                  Salir
                </NavLink>
              </NavItem>
            </Nav>
          ) : (
            <Nav className="ml-auto" navbar>
              <NavItem onClick={props.logout}>
                <NavLink
                  to="/login"
                  onClick={props.logout}
                  activeClassName="active"
                  tag={RRNavLink}
                >
                  Salir
                </NavLink>
              </NavItem>
            </Nav>
          )}
        </Collapse>
      </Navbar>
    </div>
  );
};

const mapStateToProps = (state) => ({
  user: state.auth.user,
  isAuthenticated: state.auth.isAuthenticated,
});
export default connect(mapStateToProps, { logout })(withRouter(NavBar));
